insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (25, 30000, 15, 2, 24001, 1, 0, '', '', 0, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (27, 40001, 1, 8, 91002, 150, 107501, '貪吃佩可', '今天是紀念日，要慶祝才行呢！\\n燒肉、壽司、披薩、蛋糕～☆\\n能和你一起開派對，\\n我好幸福～♪', 1, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (28, 40001, 2, 8, 91002, 150, 107601, '可可蘿', '能夠在今天迎來這個紀念日，\\n全拜主人的器量所賜。\\n真不愧是主人呢。\\n真了不起真了不起♪', 1, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (29, 40001, 3, 8, 91002, 150, 107801, '凱留', '你還挺能幹的嘛！\\n我有點…還蠻…非、非常\\n對你刮目相看了呢。\\n我就誇誇你吧♪', 1, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (30, 40001, 4, 8, 91002, 150, 107701, '鈴莓', '對您和我來說，\\n今天是個特別的日子。\\n因為有了您的支持，\\n我才能夠如此努力！', 1, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (31, 40001, 5, 8, 91002, 150, 107901, '珠希', '今天對你來說是個\\n特別的紀念日呢喵。\\n對於你的活躍，我總是\\n以貓的方式在感謝你喵～♪', 1, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (32, 40001, 6, 8, 91002, 150, 107501, '貪吃佩可', '嗚～吃了太多的刨冰，\\n身體變得好冷哦…\\n請用你的體溫溫暖我吧！\\n抱緊──♪', 2, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (33, 40001, 7, 8, 91002, 150, 107601, '可可蘿', '夏天總是充滿著許多的危險…\\n但是在下會好好地\\n保護著主人的哦。', 2, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (34, 40001, 8, 8, 91002, 150, 107801, '凱留', '嗯～到底為什麼會和你\\n一起度過了一整個夏天啊…\\n雖然我很開心就是了！\\n來吧，我們要繼續玩囉！', 2, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (35, 40001, 9, 8, 91002, 150, 107701, '鈴莓', ' 和您一起度過的第一個夏天…\\n我現在就已經心跳不已了呢。\\n快樂又美好的回憶，\\n又增加一個了呢♪', 2, 0);
insert into v1_ab46e61efa6f943a910e9cc49b5110b2b084e629522e9d4f3bc3a38ccf38a84d values (36, 40001, 10, 8, 91002, 150, 107901, '珠希', '明明夏天是最好賺錢的時候，\\n但今年我卻想和你\\n一起度過呢喵。你能和我一起\\n創造愉快的回憶喵？', 2, 0);
